CREATE TABLE  IF NOT EXISTS Empresa (
	CIF VARCHAR(25),
  Nombre VARCHAR(45) NOT NULL,
	Capital REAL NOT NULL,
	PRIMARY KEY (CIF)
);

CREATE TABLE IF NOT EXISTS Agencia_espacial (
	Nombre VARCHAR(45),
	Cant_per INT,
	PRIMARY KEY (Nombre)
);


CREATE TABLE IF NOT EXISTS Publica (
	Nombre VARCHAR(45),
	Estado VARCHAR(45) NOT NULL,
	PRIMARY KEY (Nombre),
	FOREIGN KEY (Nombre) REFERENCES Agencia_espacial (Nombre)
	ON DELETE CASCADE
	ON UPDATE NO ACTION
);


CREATE TABLE IF NOT EXISTS Privada (
	Nombre VARCHAR(45),
	Publica_N VARCHAR(45) NOT NULL,
	PRIMARY KEY (Nombre, Publica_N),
	FOREIGN KEY (Nombre) REFERENCES Agencia_espacial (Nombre),
	FOREIGN KEY (Publica_N) REFERENCES Publica (Nombre)
	ON DELETE CASCADE
	ON UPDATE NO ACTION
);


CREATE TABLE IF NOT EXISTS Financia (
  P_Nombre VARCHAR(45) NOT NULL,
  E_CIF VARCHAR(45) NOT NULL,
  Participacion REAL NOT NULL,
  PRIMARY KEY (P_Nombre, E_CIF),
  FOREIGN KEY (P_Nombre) REFERENCES Privada (Nombre),
  FOREIGN KEY (E_CIF) REFERENCES Empresa (CIF)
  ON DELETE CASCADE
  ON UPDATE NO ACTION
);

CREATE TABLE IF NOT EXISTS Orbita (
  radio REAL,
  Delta REAL,
  Altura REAL,
  Excentricidad REAL,
  Forma VARCHAR(8),
  Geoestacionaria VARCHAR(2) NOT NULL,
  PRIMARY KEY (radio, Delta, Altura, Excentricidad)
);


CREATE TABLE IF NOT EXISTS Nave (
  Matricula VARCHAR(30),
  F_lanzamiento DATETIME NOT NULL,
  Misi√≥n VARCHAR(10) NOT NULL,
  Agencia VARCHAR(45),
  PRIMARY KEY (Matricula, Agencia),
  FOREIGN KEY (Agencia) REFERENCES Agencia_espacial (Nombre)
  ON DELETE NO ACTION
  ON UPDATE NO ACTION
);


CREATE TABLE IF NOT EXISTS Clase_nave (
  prefijo VARCHAR(20), 
  nombre VARCHAR(45),
  PRIMARY KEY (prefijo)
);

CREATE TABLE IF NOT EXISTS Pertenece_a (
  cn_prefijo VARCHAR(20),
  nave VARCHAR(30),
  PRIMARY KEY (cn_prefijo, nave),
  FOREIGN KEY (cn_prefijo) REFERENCES Clase_nave (prefijo),
  FOREIGN KEY (nave) REFERENCES Nave (Matricula)
);

CREATE TABLE IF NOT EXISTS Se_ubica (
  nave VARCHAR(30),
  o_radio REAL,
  o_delta REAL,
  o_altura REAL,
  o_excentricidad REAL,
  fecha_inicial DATETIME,
  fecha_final DATETIME,
  PRIMARY KEY (nave, o_radio, o_delta, o_altura, o_excentricidad),
  FOREIGN KEY (o_radio , o_delta, o_altura, o_excentricidad) REFERENCES Orbita (radio , Delta, Altura, excentricidad),
  FOREIGN KEY (nave) REFERENCES Nave (Matricula)
);


CREATE TABLE IF NOT EXISTS Componente (
  C√≥digo INT,
  Tipo VARCHAR(30) NOT NULL,
  Peso REAL NOT NULL,
  Diametro REAL NOT NULL,
  cn_prefijo VARCHAR(20) NOT NULL,
  PRIMARY KEY (C√≥digo),
  FOREIGN KEY (cn_prefijo) REFERENCES Clase_nave (prefijo)
);

CREATE TABLE IF NOT EXISTS Basura_espacial (
  id_Basura INT,
  id_Badura_Origen INT DEFAULT NULL,
  Peso REAL NOT NULL,
  Diametro REAL NOT NULL,
  Velocidad REAL NOT NULL,
  Tama√±o REAL NOT NULL,
  O_radio REAL NOT NULL,
  O_Delta REAL NOT NULL,
  O_Altura REAL NOT NULL, 
  O_excentricidad REAL NOT NULL,
  Nave VARCHAR(30) NOT NULL,
  PRIMARY KEY (id_Basura),
  FOREIGN KEY (O_radio , O_Delta, O_Altura, O_excentricidad) REFERENCES Orbita (radio, Delta, Altura, excentricidad),
  FOREIGN KEY (Nave) REFERENCES Nave (Matricula),
  FOREIGN KEY (id_Badura_Origen) REFERENCES Basura_espacial(id_Basura)
);


CREATE TABLE IF NOT EXISTS Posicion (
  id_basura INT,
  fecha_posicion DATETIME,
  radio REAL NOT NULL,
  delta REAL NOT NULL,
  altura REAL NOT NULL,
  excentricidad REAL NOT NULL,
  PRIMARY KEY (id_basura, fecha_posicion),
  FOREIGN KEY (id_basura) REFERENCES Basura_espacial(id_Basura)
  ON DELETE CASCADE
  ON UPDATE CASCADE
);

CREATE TABLE IF NOT EXISTS Tripulantes (
  Nombre VARCHAR(45),
  Nave VARCHAR(30) NOT NULL,
  PRIMARY KEY (Nombre),
  FOREIGN KEY (Nave) REFERENCES Nave (Matricula)
  ON DELETE CASCADE
  ON UPDATE CASCADE
);